import React, { useState, useEffect } from 'react';
import fetchOpenFoodFacts from './test.jsx';

const FoodList = () => {
  const [foodData, setFoodData] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const data = await fetchOpenFoodFacts();
        setFoodData(data);
        setLoading(false);
      } catch (error) {
        setError(error.message);
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <h1>Food Products Containing Milk</h1>
      {foodData && foodData.products ? (
        <ul>
          {foodData.products.map((product, index) => (
            <li key={index}>
              <h2>{product.product_name}</h2>
              <p>Brand: {product.brands}</p>
              <p>Quantity: {product.quantity}</p>
              <p>Ingredients: {product.ingredients_text}</p>
              <p>Allergens: {product.allergen}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No products found.</p>
      )}
    </div>
  );
};

export default FoodList;
